import React, { Component } from 'react';
import './App.css';

import Contact from './Contact.js'

class App extends Component {  

  render() {
    return (

     <div className="background">
      <div className="main">
      <div className="typewriter">
       TFSites
      </div>
      <div className="rowflex">
      <div className="enter">
       Sites
      </div>
      <div className="enter">
       About
      </div>
      <div className="enter">
       Contact <Contact />
      </div>
      </div>
      </div>
     </div>

    );
  }
} 

export default App;
